import React from 'react';
import './App.css';
import Home from './containers/home'
import Header from './containers/header'
import Logo from './containers/logo'
import NavBar from './containers/navBar'
import MainContainer1 from './containers/mainContainer1';
import img3 from './containers/images/pic3.jpg'
import Hero2 from './containers/hero2'
import Footer1 from './containers/footer/footer1'
import FooterContent from './containers/footer/footerContent'



function App() {
  return ( 
    <div className="App">
      <Header />
      <Logo />
      <NavBar />
      <Hero2/>
      <MainContainer1 />
      <FooterContent />

    </div>
  );
}

export default App;
